import './redes_sociais.css'

function Redes_Sociais(){
    return(
        <div className='container mt-2'>
           <i class="fa-brands fa-linkedin"></i> <a className="linkedin " href="/">LinkedIn</a><i class="fa-solid fa-arrow-up-right-from-square me-3"></i>

           <i class="fa-brands fa-github"></i> <a className="git me-3" href="/">Github</a><i class="fa-solid fa-arrow-up-right-from-square"></i>
        </div>
    );
}

export default Redes_Sociais;
